import{_ as e,o as a,c as r,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 38.2-3125 Other rights of beneficiaries and assignees protected.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-3125.md","filePath":"vacode/38.2-3125.md"}'),t={name:"vacode/38.2-3125.md"},o=i('<h1 id="§-38-2-3125-other-rights-of-beneficiaries-and-assignees-protected" tabindex="-1">§ 38.2-3125 Other rights of beneficiaries and assignees protected. <a class="header-anchor" href="#§-38-2-3125-other-rights-of-beneficiaries-and-assignees-protected" aria-label="Permalink to &quot;§ 38.2-3125 Other rights of beneficiaries and assignees protected.&quot;">​</a></h1><p>Since the purpose of §§ <a href="/vacode/38.2-3122/">38.2-3122</a> and <a href="/vacode/38.2-3122.1/">38.2-3122.1</a> is to confer additional rights, privileges, and benefits upon beneficiaries and assignees of policies, no beneficiary or assignee shall by reason of these sections be divested or deprived of or prohibited from exercising or enjoying any right, privilege, or benefit that he would have or could exercise or enjoy had §§ <a href="/vacode/38.2-3122/">38.2-3122</a> and <a href="/vacode/38.2-3122.1/">38.2-3122.1</a> not been enacted.</p><p>Code 1950, § 38-119; 1952, c. 317, § 38.1-451; 1986, c. 562; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0304" target="_blank" rel="noreferrer">304</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0847" target="_blank" rel="noreferrer">847</a>.</p>',3),s=[o];function n(c,d,f,h,p,l){return a(),r("div",null,s)}const b=e(t,[["render",n]]);export{g as __pageData,b as default};
